function _m(o, m) {
	if ('undefined' == typeof LANG || !LANG[o][m]) return ''
	var t = LANG[o][m]
	for (var i = 2; i < arguments.length; i++) {
		t = t.replace(new RegExp('\\$' + (i - 1), 'g'), arguments[i])
	}
	if(undefined !== typeof SPEECH) SPEECH.falar(t)
	return t
}

